import React, { useState } from 'react';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import TablePay from './TablePayment';
import FormPayProducts from './FormPay';

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: theme.palette.text.secondary,
}));

const Div = styled('div')(({ theme }) => ({
  ...theme.typography.button,
  backgroundColor: theme.palette.background.paper,
  padding: theme.spacing(1),
}));

const products = [
  createData('India', 'IN', 1324171354, 3287263),
  createData('China', 'CN', 1403500365, 9596961),
  createData('Italy', 'IT', 60483973, 301340),
  createData('United States', 'US', 327167434, 9833520),
  createData('Canada', 'CA', 37602103, 9984670),
  createData('Australia', 'AU', 25475400, 7692024),
  createData('Germany', 'DE', 83019200, 357578),
  createData('Ireland', 'IE', 4857000, 70273),
  createData('Mexico', 'MX', 126577691, 1972550),
  createData('Japan', 'JP', 126317000, 377973),
  createData('France', 'FR', 67022000, 640679),
  createData('United Kingdom', 'GB', 67545757, 242495),
  createData('Russia', 'RU', 146793744, 17098246),
  createData('Nigeria', 'NG', 200962417, 923768),
  createData('Brazil', 'BR', 210147125, 8515767),
];

// function createData(name, code, population, size) {
//   const density = population / size;
//   return { name, code, population, size, density };
// }

// function createData(Sku, Name, Quantity, Price) {
//   return { Sku, Name, Quantity, Price };
// }

export default function AutoGrid() {

  const [datos, setDatos] = useState([])

  console.log('Datos', datos)

  return (
    <Box sx={{ flexGrow: 1 }} m={5}>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Item>
            <Div>{"Agregar producto"}</Div>
            <FormPayProducts datos={datos} setDatos={setDatos} />
          </Item>
        </Grid>
        <Grid item xs={12}>
          <Item>
            <Div>{"Listado de productos"}</Div>
            <TablePay products={datos} />
          </Item>
        </Grid>
      </Grid>
    </Box>
  );
}
